import './Login.css';
import BackGround from '../UI/BackGround';

import { Link } from 'react-router-dom';
import { useState, useEffect } from 'react';
import { useForm } from 'react-hook-form';

const Login = () => {
	// const initialValues = { name: '', email: '', password: '' };
	// const [RegisterValue, setRegisterValue] = useState(initialValues);
	// const [RegisterError, setRegisterError] = useState({});
	// const [isSubmit, setIsSubmit] = useState(false);

	// const handleChange = (e) => {
	// 	const { name, value } = e.target;
	// 	setRegisterValue({ ...RegisterValue, [name]: value });
	// };

	// const handleSubmit = (e) => {
	// 	e.preventDefault();
	// 	setRegisterError(validationData(RegisterValue));
	// 	setIsSubmit(true);
	// };

	// useEffect(() => {
	// 	console.log(RegisterError);
	// 	if (Object.keys(RegisterError).length === 0 && isSubmit) {
	// 		console.log(RegisterValue);
	// 	}
	// });

	// const validationData = (values) => {
	// 	const errors = {};
	// 	const regex = /^[^\s@]+@[^\s@]+\.[^\s@]{2,}$/i;
	// 	if (!values.name) {
	// 		errors.name = 'Name is required';
	// 	}
	// 	if (!values.email) {
	// 		errors.email = 'Email is required';
	// 	}
	// 	if (!values.password) {
	// 		errors.password = 'Password is required';
	// 	}
	// 	return errors;
	// };

	const { register, handleSubmit, errors } = useForm();
	const [userInfo, setUserInfo] = useState();
	const onSubmit = (data) => {
		setUserInfo(data);
		console.log(data);
	};

	return (
		<div>
			<pre>{JSON.stringify(userInfo, undefined, 2)}</pre>
			<BackGround />
			<div class='main_login'>
				<input type='checkbox' id='chk' aria-hidden='true' />

				<div class='signup'>
					<form onSubmit={handleSubmit(onSubmit)}>
						<label className='lbl__main reg' htmlFor='chk' aria-hidden='true'>
							Rejestracja
						</label>
						<input
							className='input__data'
							type='text'
							name='name'
							placeholder='Imię'
							reference={register({ required: 'Username is required' })}
							// value={RegisterValue.name}
							// onChange={handleChange}
							required=''
						/>
						<input
							className='input__data'
							type='email'
							name='email'
							// value={RegisterValue.email}
							// onChange={handleChange}
							reference={register({ required: 'email is required' })}
							placeholder='Email'
							required=''
						/>
						<input
							className='input__data'
							type='password'
							name='password'
							// value={RegisterValue.password}
							// onChange={handleChange}
							reference={register({ required: 'password is required' })}
							placeholder='Hasło'
							required=''
						/>
						<div className='container_radio'>
							<div className='btn__radio'>
								<input
									type='radio'
									id='huey'
									name='user'
									value='user'
									checked
								/>
								<label htmlFor='huey' className='lbl-user'>
									Użytkownik
								</label>
							</div>
							<div className='btn__radio'>
								<input type='radio' id='dewey' name='user' value='teacher' />
								<label htmlFor='dewey' className='lbl-user'>
									Nauczyciel
								</label>
							</div>
						</div>
						<button className='btn-log'>Zatwierdź</button>
					</form>

					<Link className='text-link' to='./'>
						{' '}
						<button className='btn-log'>Powrót</button>
					</Link>
				</div>

				<div class='login'>
					<form>
						<label className='lbl__main log' htmlFor='chk' aria-hidden='true'>
							Logowanie
						</label>
						<input
							className='input__data'
							type='email'
							name='email'
							placeholder='Email'
							required=''
						/>
						<input
							className='input__data'
							type='password'
							name='pswd'
							placeholder='Password'
							required=''
						/>
						<button className='btn-log'>Login</button>
					</form>
				</div>
			</div>
		</div>
	);
};

export default Login;
